import React from "react";
import "./styles.css";

const DocumentsButtons = ({ handleConvert, handleClear, handleGlobal }) => {
  return (
    <div className="button-group">
      <button className="compare-button" onClick={handleConvert}>
        Convert
      </button>
      <button className="convert-button" onClick={() => handleGlobal("merge", false)}>
        Merge
      </button>
      <button className="clear-button" onClick={handleClear}>
        Clear
      </button>
    </div>
  );
};

export default DocumentsButtons;
